import React from "react";
import PropTypes from "prop-types";
import classNames from "classnames";
import { withStyles } from "@material-ui/core/styles";
import Drawer from "@material-ui/core/Drawer";
import List from "@material-ui/core/List";
import CssBaseline from "@material-ui/core/CssBaseline";
import Divider from "@material-ui/core/Divider";
import ListItem from "@material-ui/core/ListItem";
import ListItemIcon from "@material-ui/core/ListItemIcon";
import ListItemText from "@material-ui/core/ListItemText";
import InboxIcon from "@material-ui/icons/MoveToInbox";


import Person from "@material-ui/icons/Person";
import DashboardIcon from "@material-ui/icons/Dashboard";
import CalendarToday from "@material-ui/icons/CalendarToday";
import Event from "@material-ui/icons/Event";
import InsertChart from "@material-ui/icons/InsertChart";
import Restaurant from "@material-ui/icons/Restaurant";

const drawerWidth = 240;
const closedDrawerWidth = 73;

const styles = theme => ({
  hide: {
    display: "none"
  },
  drawer: {
    width: drawerWidth,
    flexShrink: 0,
    whiteSpace: "nowrap"
  },
  drawerOpen: {
    width: drawerWidth,
    transition: theme.transitions.create("width", {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.enteringScreen
    })
  },
  drawerClose: {
    transition: theme.transitions.create("width", {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen
    }),
    overflowX: "hidden",
    width: theme.spacing.unit * 7 + 1,
    [theme.breakpoints.up("sm")]: {
      width: theme.spacing.unit * 9 + 1
    }
  },
  toolbar: {
    display: "flex",
    alignItems: "center",
    justifyContent: "flex-middle",
    padding: "0 8px",
    ...theme.mixins.toolbar
  },
  content: {
    flexGrow: 1,
    padding: theme.spacing.unit * 3
  },
});
class Sidebar extends React.Component {
  constructor(props){
    super(props);
      this.state = {
          open: this.props.open
      };
  }


  render() {
    const { classes, theme } = this.props;

    return (
      <div>
        <CssBaseline />
        <Drawer
          variant="permanent"
          className={classNames(classes.drawer, {
            [classes.drawerOpen]: this.state.open,
            [classes.drawerClose]: !this.state.open
          })}
          classes={{
            paper: classNames({
              [classes.drawerOpen]: this.state.open,
              [classes.drawerClose]: !this.state.open
            })
          }}
          open={this.state.open}
        >
          <div
            style={{ height: "180px" }}
            className={classNames({
              [classes.hide]: !this.state.open
            })}
          >
            <h2> Logo</h2>
            <h3>Consultorio María Matayuca</h3>
          </div>
          <div
            style={{ height: "64px" }}
            className={classNames({
              [classes.hide]: this.state.open
            })}
          >
            <h2>{!this.state.open && ("cerradp")}</h2>
          </div>
          <Divider />
          <List>
            <ListItem button key="dashboard">
              <ListItemIcon>
                <DashboardIcon />
              </ListItemIcon>
              <ListItemText primary="Inicio" />
            </ListItem>
            <ListItem button key="patients">
              <ListItemIcon>
                <Person />
              </ListItemIcon>
              <ListItemText primary="Pacientes" />
            </ListItem>
            <ListItem button key="schedule">
              <ListItemIcon>
                <CalendarToday />
              </ListItemIcon>
              <ListItemText primary="Agenda" />
            </ListItem>
            <ListItem button key="mealplan">
              <ListItemIcon>
                <Restaurant />
              </ListItemIcon>
              <ListItemText primary="Plan Alimenticio" />
            </ListItem>
            <ListItem button key="templates">
              <ListItemIcon>
                <InboxIcon />
              </ListItemIcon>
              <ListItemText primary="Recetas" />
            </ListItem>
            <ListItem button key="stats">
              <ListItemIcon>
                <InsertChart style={{ color: "green" }} />
              </ListItemIcon>
              <ListItemText primary="Estadísticas" />
            </ListItem>
          </List>
          <Divider />
          <List style={{ bottom: "0px", position: "absolute" }}>
            <ListItem button key="start_appointment">
              <ListItemIcon>
                <InsertChart style={{ color: "orange" }} />
              </ListItemIcon>
              <ListItemText primary="Iniciar Consulta" />
            </ListItem>
            <ListItem button key="schedule_appointment">
              <ListItemIcon>
                <Event style={{ color: "blue" }} />
              </ListItemIcon>
              <ListItemText primary="Agendar Consulta" />
            </ListItem>
          </List>
        </Drawer>
      </div>
    );
  }
}

Sidebar.propTypes = {
  classes: PropTypes.object.isRequired,
  theme: PropTypes.object.isRequired
};

export default withStyles(styles, { withTheme: true })(Sidebar);
